import Sequelize from 'sequelize';

import { sequelize } from '../database/database';
import Task from './Tasks';

const Project = sequelize.define('projects', {
    id: {
        type: Sequelize.INTEGER,
        primaryKey: true
    },
    name: {
        type: Sequelize.TEXT
    },
    priority: {
        type: Sequelize.INTEGER
    },
    description: {
        type: Sequelize.TEXT
    },
    deliverydate: {
        type: Sequelize.DATE
    },
}, {
    timestamps: false
});

Project.hasMany(Task, { foreignKey: 'projectid', sourcekey: 'id' }); // Uno a muchos proyectos
Task.belongsTo(Project, { foreignKey: 'projectid', sourcekey: 'id' }); // Muchas tareas pertenece a un solo projecto

export default Project;

