import Task from '../models/Tasks';

export async function getTasks(req, res) {
    const tasks = await Task.findAll({
        attributes: ['id', 'projectid', 'name', 'done'],
        order: [
            ['id', 'DESC']
        ]
    });

    res.json({
      tasks
    });
}

export async function createTask(req, res) {
  const { name, done, projectid } = req.body;

  const newTask = await Task.create(
    {
      name,
      done,
      projectid,
    },
    {
      fields: ['name', 'done', 'projectid']
    }
  );

  res.json({
    message: 'New task created!',
  });
}

export async function getTaskById(req, res) {
    const { id } = req.params;

    const task = await Task.findOne({
        where: {
            id
        }
    });

    res.json(task);
}

export async function deleteTaskById(req, res) {
    const { id } = req.params;

    Task.destroy({
        attributes: ['id', 'name', 'done', 'projectid'],
        where: {
            id
        }
    });

    res.send({
        message: 'Task deleted!'
    });
}

export async function updateTaskById(req, res) {
    const { id } = req.params;
    const { projectid, name, done } = req.body;

    const task = await Task.findOne({
        attributes: ['id', 'name', 'done', 'projectid'],
        where: {
            id
        }
    });

    const udateTask = await Task.update({
        name,
        done,
        projectid
    },
    {
        where: { id }
    });

    res.json({
        message: 'Task updated!',
        udateTask
    });
}

export async function geTaskByProject(req, res) {
    const { projectid } = req.params;

    const task = await Task.findAll({
        attributes: ['id', 'name', 'done', 'projectid'],
        where: { projectid }
    });

    res.json({
        tasks: task
    });
}

